import React from "react";
import Proptypes from "prop-types";
import { connect } from "react-redux";

const Alert = props => {
  console.log("hello")
  return (
    <div>
      <h1>Hello</h1>
    </div>
  )
};

Alert.propTypes = {
  alerts: PropTypes.array.isRequired
};
const mapStateToProps = state => ({
  alerts: state.alert
})

export default connect()(Alert);
